function changeImage(g){var b=g.lastIndexOf(".");var f=g.slice(b,g.length);var e=g.slice(0,g.length-4);var a;if(g.search("/")!=-1){a=e}else{var c,d;for(c=0;c>(-e.length);c--){d=e.slice(e.length+c,e.length);if(d.search("/")!=-1){a=d.substring(1);break}}}if(a.search(1)!=-1){return g.slice(0,g.length-a.length-f.length)+a.slice(0,a.length-1)+f}else{return g.slice(0,g.length-a.length-f.length)+a+"1"+f}}$(document).ready(function(){$(".button").hover(function(){if(!$(this).hasClass("disabled")){var a=$(this).attr("src");$(this).attr("src",changeImage(a))}})});